import { Component } from '@angular/core';

@Component({
  selector: 'app-auth',
  templateUrl: './login.component.html',
  styleUrls: ['./auth.component.css']
})
export class AuthComponent {
  username: string = '';
  email: string = '';
  password: string = '';
}
